class Solution:
    def findKthLargest(self, nums: List[int], k: int) -> int:

        minheap = []

        for num in nums:
            heapq.heappush(minheap, num)

            if len(minheap) > k:
                heapq.heappop(minheap)

        return minheap[0]

class Solution:
    def findKthLargest(self, nums: List[int], k: int) -> int:

        heapq.heapify(nums)

        while (len(nums)) > k:
            heapq.heappop(nums)

        return nums[0]

class Solution:
    def kClosest(self, points: List[List[int]], k: int) -> List[List[int]]:

        dist = [[math.sqrt(x**2 + y**2), x, y] for (x, y) in points]
        heapq.heapify(dist)
        res = []

        for i in range(k):
            d, x, y = heapq.heappop(dist)
            res.append([x, y])

        return res

