int n, c;
vi v;

vector<vi> dp;

int fun(int i, int p)
{
    if (dp[i][p] != -1)
        return dp[i][p];
    if (i == n - 1)
    {
        return dp[i][p] = (((v[i] - v[p]) * (v[i] - v[p])) + c);
    }
    // take
    int take = (((v[i] - v[p]) * (v[i] - v[p])) + c) + fun(i + 1, i);

    // not take
    int nottake = fun(i + 1, p);

    return dp[i][p] = min(take, nottake);
}

